  /**
   * Unpacked 6D output coordinates.
   */
  protected getOutputUnpacked6DCoords(shape: [number, number, number, number, number, number], texShape: [
    number, number
  ]): GlslLibRoutine {
    let source = '';
    const rank = shape.length;

    let strides = null;
